// Fun√ß√£o para multiplicar part√≠culas
function duplicatePoints(points, times = 2) {
  const result = [];
  for (const p of points) {
    for (let i = 0; i < times; i++) {
      result.push({
        x: p.x + Math.random() * 0.5,
        y: p.y + Math.random() * 0.5
      });
    }
  }
  return result;
}

// Cria√ß√£o das part√≠culas pretas
function createParticles(points, color) {
  return duplicatePoints(points, 2).map(p => ({
    x: canvas.width / 2,
    y: canvas.height / 2,
    vx: (Math.random() - 0.5) * 10,
    vy: (Math.random() - 0.5) * 10,
    tx: p.x * scale + offsetX,
    ty: p.y * scale + offsetY,
    color: color,
    size: 1
  }));
}

const particles = createParticles(fPoints, "#000000");

let time = 0;
function animate() {
  ctx.clearRect(0, 0, canvas.width, canvas.height);
  time++;

  particles.forEach(p => {
    if (time < 60) {
      p.x += p.vx;
      p.y += p.vy;
    } else {
      p.x += (p.tx - p.x) * 0.07;
      p.y += (p.ty - p.y) * 0.07;
    }

    ctx.fillStyle = p.color;
    ctx.beginPath();
    ctx.arc(p.x, p.y, p.size, 0, Math.PI * 2);
    ctx.fill();
  });

  requestAnimationFrame(animate);
}

animate();
</script>
